import Member from './Member';
import logo from './logo.svg';

const Greet = () => {
  const style = {
    backgroundColor: 'blue',
    color: 'white',
    border: '5px',
  };

  return (
    <>
      <div style={style}>
        안녕?? <Member name="이태성" />
        <img src={logo} className="App-logo" alt="logo" />
      </div>
    </>
  );
};
export default Greet;
